webpackJsonp([0xee96de219e0a],{2337:function(n,e){n.exports={pathContext:{docHtml:'<h1>find-up <a href="https://travis-ci.org/sindresorhus/find-up"><img src="https://travis-ci.org/sindresorhus/find-up.svg?branch=master" alt="Build Status: Linux and macOS"></a> <a href="https://ci.appveyor.com/project/sindresorhus/find-up/branch/master"><img src="https://ci.appveyor.com/api/projects/status/l0cyjmvh5lq72vq2/branch/master?svg=true" alt="Build Status: Windows"></a></h1>\n<blockquote>\n<p>Find a file by walking up parent directories</p>\n</blockquote>\n<h2>Install</h2>\n<pre><code>$ npm install --save find-up\n</code></pre>\n<h2>Usage</h2>\n<pre><code>/\n└── Users\n        └── sindresorhus\n                ├── unicorn.png\n                └── foo\n                        └── bar\n                                ├── baz\n                                └── example.js\n</code></pre>\n<pre><code class="language-js">// example.js\nconst findUp = require(\'find-up\');\n\nfindUp(\'unicorn.png\').then(filepath => {\n    console.log(filepath);\n    //=> \'/Users/sindresorhus/unicorn.png\'\n});\n\nfindUp([\'rainbow.png\', \'unicorn.png\']).then(filepath => {\n    console.log(filepath);\n    //=> \'/Users/sindresorhus/unicorn.png\'\n});\n</code></pre>\n<h2>API</h2>\n<h3>findUp(filename, [options])</h3>\n<p>Returns a <code>Promise</code> for the filepath or <code>null</code>.</p>\n<h3>findUp([filenameA, filenameB], [options])</h3>\n<p>Returns a <code>Promise</code> for the first filepath found (by respecting the order) or <code>null</code>.</p>\n<h3>findUp.sync(filename, [options])</h3>\n<p>Returns a filepath or <code>null</code>.</p>\n<h3>findUp.sync([filenameA, filenameB], [options])</h3>\n<p>Returns the first filepath found (by respecting the order) or <code>null</code>.</p>\n<h4>filename</h4>\n<p>Type: <code>string</code></p>\n<p>Filename of the file to find.</p>\n<h4>options</h4>\n<h5>cwd</h5>\n<p>Type: <code>string</code><br>\nDefault: <code>process.cwd()</code></p>\n<p>Directory to start from.</p>\n<h2>Related</h2>\n<ul>\n<li><a href="https://github.com/sindresorhus/find-up-cli">find-up-cli</a> - CLI for this module</li>\n<li><a href="https://github.com/sindresorhus/pkg-up">pkg-up</a> - Find the closest package.json file</li>\n<li><a href="https://github.com/sindresorhus/pkg-dir">pkg-dir</a> - Find the root directory of an npm package</li>\n</ul>\n<h2>License</h2>\n<p>MIT © <a href="https://sindresorhus.com">Sindre Sorhus</a></p>',docPath:"argo-ci/node_modules/find-up/readme",proj:"argo-ci"}}}});
